import React, { Component} from "react";
import './Projects_page.css';
import Portfolio from './portfolioss.png';
import Event_O_Mania from './Event_O_Maniass.png';
import Elite_Homes from './Elite_Homes_ss.png';

class Projects_page extends Component {
    render() {
        return(
            <div className="Main-Projects_page">
                <div className="Projects_page_content">
                <h1>My Projects</h1>
                <h6>Expect the best, plan for the worst, and prepare to be surprised</h6>
                <div className="Projects_pic_div">

                    <div style={{flex : "1", backgroundColor : "white", marginRight : "1.5%"}}>
                        <img src={Portfolio} alt="portfolio_pic" width={"90%"}/>
                        <h2 className="project_pic_head">My Portfolio</h2>
                <h5>Portfolio is a piece of design that speaks for me. It is created with the help of languages like React JS, CSS etc.</h5>
                    </div>

                    <div style={{flex : "1", backgroundColor : "white", marginRight : "1.5%"}}>
                    <img src={Elite_Homes} alt="portfolio_pic" width={"90%"}/>
                    <h2 className="project_pic_head">Elite Homes</h2>
                    <h6><i>hey sahil</i></h6>
                <h5>Elite Homes is a website created with the help of HTML, CSS and some basic Javascript, Which helps the user for buying required items for building his home from first brick to final touch.</h5>
                    </div>

                    <div style={{flex : "1", backgroundColor : "white"}}>
                    <img src={Event_O_Mania} alt="portfolio_pic" width={"90%"}/>
                    <h2 className="project_pic_head">Event-O-Mania</h2>
                <h5>Event-O-Mania is a website created with the help of HTML, CSS and Vanilla Javascript, Which is developed for the purpose of planning Events like weddings, parties.</h5>
                    </div>

                </div>
                </div>
            </div>
        )
    }
}

export default Projects_page;
